also here's a free script to check if your docker subtensor is running
```import subprocess
import time

def check_container_running(container_name):
    try:
        # Check if the container is running
        result = subprocess.run(['docker', 'ps', '--filter', f'name={container_name}', '--format', '{{.Names}}'], stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        return container_name in result.stdout.decode('utf-8')
    except subprocess.CalledProcessError as e:
        print(f"Error checking container status: {e}")
        return False

def restart_subtensor():
    try:
        commands = [
            'cd /root/subtensor',
            'docker compose down --volumes',
            'sudo ./scripts/run/subtensor.sh -e docker --network mainnet --node-type lite',
            'cd ..',
            'pm2 restart all'
        ]
        full_command = ' && '.join(commands)
        result = subprocess.run(full_command, shell=True, stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        if result.returncode == 0:
            print("Commands executed successfully.")
        else:
            print(f"Error executing commands: {result.stderr.decode('utf-8')}")
    except Exception as e:
        print(f"An error occurred: {e}")

container_name = 'subtensor-mainnet-lite'

while True:
    if not check_container_running(container_name):
        print(f"{time.strftime('%Y-%m-%d %H:%M:%S')} - Container {container_name} is not running. Executing commands...")
        restart_subtensor()
    else:
        print(f"{time.strftime('%Y-%m-%d %H:%M:%S')} - Container {container_name} is running.")

    # Wait for 60 seconds before checking again
    time.sleep(60)```

