Another script I wrote and use on my miners is a script called SubAlive. This will consistently check your docker containers for the Subtensor container to ensure your Subtensor hasn't crashed. Often I found my Subtensors would crash after about a week, which obviously resulted in emission crashes, however this script will detect that happening and automatically restart your container and your miner as well as any other scripts being used in pm2.

Note: This requires you to use Docker - this will not work for those using the Rust / Source code setup for Subtensor. This also requires you to have the Subtensor git repo in your /root/subtensor directory, however you can change the directory if you have it placed elsewhere.

I have Telegram built into the script to text you whenever it detects a downage. You will have to setup a Telegram bot and get the Token ID as well as the chat ID for it to function correctly.

```import subprocess
import time
import requests
import os

TELEGRAM_TOKEN = 'TELEGRAM TOKEN HERE'
CHAT_ID = 'TELEGRAM CHAT ID HERE'

def send_telegram_message(message):
    url = f'https://api.telegram.org/bot{TELEGRAM_TOKEN}/sendMessage'
    payload = {
        'chat_id': CHAT_ID,
        'text': message
    }
    try:
        response = requests.post(url, data=payload)
        response.raise_for_status()
        print("Telegram message sent successfully.")
    except requests.exceptions.RequestException as e:
        print(f"Failed to send Telegram message: {e}")

def check_container_running(container_name):
    try:
        result = subprocess.run(['docker', 'ps', '--filter', f'name={container_name}', '--format', '{{.Names}}'], stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        return container_name in result.stdout.decode('utf-8')
    except subprocess.CalledProcessError as e:
        print(f"Error checking container status: {e}")
        return False

def restart_subtensor():
    try:
        os.chdir('/root/subtensor')
        result = subprocess.run(['docker', 'compose', 'down', '--volumes'], stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        if result.returncode != 0:
            print(f"Error bringing down Docker Compose: {result.stderr.decode('utf-8')}")
            return
        print("Docker Compose environment brought down successfully.")

        result = subprocess.run(['sudo', './scripts/run/subtensor.sh', '-e', 'docker', '--network', 'mainnet', '--node-type', 'lite'], stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        if result.returncode != 0:
            print(f"Error running subtensor script: {result.stderr.decode('utf-8')}")
            return
        print("Subtensor script executed successfully.")

        os.chdir('..')
        result = subprocess.run(['pm2', 'restart', 'all'], stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        if result.returncode != 0:
            print(f"Error restarting PM2 processes: {result.stderr.decode('utf-8')}")
            return
        print("PM2 processes restarted successfully.")
    except Exception as e:
        print(f"An error occurred: {e}")

container_name = 'subtensor-mainnet-lite'
previously_down = False

while True:
    if not check_container_running(container_name):
        if not previously_down:
            message = f"{time.strftime('%Y-%m-%d %H:%M:%S')} - Container {container_name} is not running. Attempting to restart..."
            print(message)
            send_telegram_message(message)
            previously_down = True
        restart_subtensor()
    else:
        previously_down = False
        print(f"{time.strftime('%Y-%m-%d %H:%M:%S')} - Container {container_name} is running.")

    time.sleep(60)```
